	background: #bf0000;
	color:#fff;
	font-weight:bold;
	padding:2px 5px;
}

div#HeaderKeyword a {
	color:#0044CC;
}

td.inventory font{font-size:10px;color:#666666;}
td.inventory{word-wrap:break-word;width:80px;}

.footer_obi {
    background: #CF3 none repeat scroll 0% 0%;
    position: fixed;
	z-index:99999999;
    left: 0px;
    bottom: 0px;
    width: 100%;
    text-align: center;
    color: #000;
    font-size: 14px;
    font-weight: bold;
    /*opacity: 0.8;*/
